import './App.css';
import Counter from './components/Counter';


function App() {

const [isVisible,setIsVisible] = useState(true)

  return (
    <div className='App' >
      <Counter/>

      <button onClick={()=> setIsVisible()}>Toggle</button>
      </div>
  );


}

export default App;
